// Set this to the solid you want (5, 8, 16, 24, 120, or if you dare, 600) (600 may crash your gpu)
#define NCELL 24

#if NCELL==5
#define SOLID cell5
#endif

// Tesseract
#if NCELL==8
#define SOLID cell8
#endif

#if NCELL==16
#define SOLID cell16
